import React from 'react';
import PlayerInfo from './PlayerInfo'; 
function Home() {
  return (
    <div style={{
      fontFamily: 'Arial, sans-serif',
      padding: '20px',
      backgroundColor: '#f0f0f0',
      minHeight: '100vh',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    }}>
      <PlayerInfo />
    </div>
  );
}

export default Home;
